import React from 'react'

export default function Item(props) {

    const { title, image } = props.item

    return (
        <div className='item grid'>
            <h4>{title}</h4>
            <div className='img-container'>
                <img className='img' src={`./${image}`} alt={title} />
            </div>
        </div>
    )
}
